create table races
(
    "raceId"    integer not null
        constraint races_pk
            primary key,
    year        integer
        constraint races_seasons_year_fk
            references seasons,
    round       integer,
    "circuitId" integer
        constraint races_circuits_circuitid_fk
            references circuits,
    name        text,
    date        text,
    time        text,
    url         text
);

alter table races
    owner to postgres;

